import logo from '../logo.svg';
import '../css/Home.css';
// Components
import SideNav from "./SideNav.js";

function Home(props) {
  return (
    <div className="Home">
      <header className="Home-header">
        <SideNav name="Test" />
        <img src={logo} className="Home-logo" alt="logo" />

      </header>
    </div>
  );
}

export default Home;
